import React from "react";
import { GoogleMap, Marker, useLoadScript } from "@react-google-maps/api";
import Header from "../header/header";
import Footer from "../footer/Footer";
import "./Product.css";
import Basket from "../myBasket/basket";

const Product = () => {
  const { isLoaded } = useLoadScript({
    googleMapsApiKey: "YOUR_GOOGLE_MAPS_API_KEY", // Replace with your API key
  });

  const mapContainerStyle = {
    width: "100%",
    height: "400px",
  };

  const center = {
    lat: 51.509865, // Latitude for East London
    lng: -0.118092, // Longitude for East London
  };

  const markers = [
    {
      position: { lat: 51.509865, lng: -0.118092 },
      title: "McDonald's East London",
    },
    {
      position: { lat: 51.507222, lng: -0.1275 },
      title: "Another McDonald's Nearby",
    },
  ];

  return (
    <div>
      <Header />

      {/* Main content */}
      <section className="banner1">
        <div className="banner-content1">
          <h1>McDonald's East London</h1>
          {/* Other content */}
        </div>
      </section>

      {/* Add Map Section */}
      <section className="map-container">
        <h2 style={{ textAlign: "center", marginBottom: "20px" }}>
          Find Us on the Map
        </h2>
        {!isLoaded ? (
          <p>Loading Map...</p>
        ) : (
          <GoogleMap
            mapContainerStyle={mapContainerStyle}
            center={center}
            zoom={12}
          >
            {markers.map((marker, index) => (
              <Marker
                key={index}
                position={marker.position}
                title={marker.title}
              />
            ))}
          </GoogleMap>
        )}
      </section>

      {/* Other sections like reviews */}
      <section className="customer review">
        <div className="head">
          <h1>Customer Reviews</h1>
          {/* Other content */}
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Product;
